import { Link } from "react-router-dom";
import logo from '../images/logo64.png';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Offcanvas from 'react-bootstrap/Offcanvas';
import Nav from 'react-bootstrap/Nav';

function MyNavbar() {
    return (
      // <nav className="navbar navbar-expand-lg fixed-top navbar-dark bg-dark">
      //   <div className="container-fluid">
      //       <Link to="/" className="navbar-brand headline d-flex align-center nav-linker"><img src={logo} alt="Irish Historical Figures" height="45"/><h3 className="px-1 mt-1 text-light">Irish Historical Figures</h3></Link>
      //       <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navigation-menu" aria-controls="navigation-menu" aria-expanded="false" aria-label="Toggle navigation">
      //         <span className="navbar-toggler-icon"></span>
      //       </button>
      //       <div className="collapse navbar-collapse" id="navigation-menu">
      //         <ul className="navbar-nav">
      //           <li className="nav-item">
      //             <Link to="/" className="nav-link">Home</Link>
      //           </li>
      //           <li className="nav-item">
      //             <Link to="/bram" className="nav-link">Bram Stoker</Link>
      //           </li>
      //           <li className="nav-item">
      //             <Link to="/anne" className="nav-link">Anne Bonny</Link>
      //           </li>
      //           <li className="nav-item">
      //             <Link to="/charles" className="nav-link">Sir Charles Parsons</Link>
      //           </li>
      //           <li className="nav-item">
      //             <Link to="/jocelyn" className="nav-link">Dame Jocelyn Bell Burnell</Link>
      //           </li>
      //           <li className="nav-item">
      //             <Link to="/ernest" className="nav-link">Ernest Shackleton</Link>
      //           </li>
      //         </ul>
      //       </div>
      //     </div>
      // </nav>
      <Navbar bg="light" expand={false}>
        <Container fluid>
          <Navbar.Brand href="#">Navbar Offcanvas</Navbar.Brand>
          <Navbar.Toggle aria-controls="offcanvasNavbar" />
          <Navbar.Offcanvas
            id="offcanvasNavbar"
            aria-labelledby="offcanvasNavbarLabel"
            placement="end"
          >
            <Offcanvas.Header closeButton>
              <Offcanvas.Title id="offcanvasNavbarLabel">Offcanvas</Offcanvas.Title>
            </Offcanvas.Header>
            <Offcanvas.Body>
              <Nav className="justify-content-end flex-grow-1 pe-3">
                <Nav.Link href="#action1">Home</Nav.Link>
                <Nav.Link href="#action2">Link</Nav.Link>
                <NavDropdown title="Dropdown" id="offcanvasNavbarDropdown">
                  <NavDropdown.Item href="#action3">Action</NavDropdown.Item>
                  <NavDropdown.Item href="#action4">Another action</NavDropdown.Item>
                  <NavDropdown.Divider />
                  <NavDropdown.Item href="#action5">
                    Something else here
                  </NavDropdown.Item>
                </NavDropdown>
              </Nav>
              <Form className="d-flex">
                <FormControl
                  type="search"
                  placeholder="Search"
                  className="me-2"
                  aria-label="Search"
                />
                <Button variant="outline-success">Search</Button>
              </Form>
            </Offcanvas.Body>
          </Navbar.Offcanvas>
        </Container>
      </Navbar>
    )
}

export default MyNavbar;
